column8:
★ナイキのシンプルなスリッポン！<br>
<br>
●前後のスウッシュ刺繍をアクセントにバイカラーを効かせたメリハリのあるデザイン！<br>
●軽量で耐久性に優れたキャンバス素材のアッパー。<br>
●中敷は伸縮性がありずれずにフィットし、着脱もしやすく履きやすいリラックスしたスタイル。<br>
●オートクレープ構造のミッドソールとヘリンボーンパターンを刻み入れたアウトソールで履き心地抜群！<br>
●ライフスタイルシューズとして楽しめ、通勤、通学などデイリー使いにもオススメです。<br>
<br>
■素材<br>
甲：合成繊維<br>
底：ゴム底<br>
■企画製造販売元 株式会社ナイキジャパン<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。


<BR>
<BR>
■サイズ 25.5cm～27.0cm<br>
■シューズサイズの選び方<br>
<br>
・通常サイズの方はハーフサイズアップ<br>
・幅広・甲高の方はワンサイズアップ<br>
<br>
※丁度良いサイズには個人差があります。目安としてお考えください。<br>
<img src="http://image.rakuten.co.jp/outlet-grasshopper/cabinet/evidence/1605-1607/724762-evidence.jpg"><br>
・メーカー希望小売価格はメーカーカタログに基づいて掲載しています。<br>
・こちらの画像のメーカー希望小売価格は税抜き価格となっております。

