蓄熱性の高い鉄製で、ふっくら焼けます。<br><br>

「角小」は卵1個用、「角」は卵2～3個用、「丸」は目玉焼きやオムレツに丁度の大きさで、一人用の万能フライパンとしても便利。<br><br>

鉄板の表面にはファイバーライン加工を施し、鉄素材の弱点だった、焦げ付き、こびりつきを限りなく抑え、油馴染みも良好。<br>
木柄には水に強いタフなチーク材を使用。<br><br>

長く使える高い耐久性、そして使い込むほど油が良く馴染み使いやすくなる。<br><br>

鉄の魅力を最大限に生かした玉子焼きフライパンです。
<br><br><br><br>



